	if strings.HasPrefix(targetStr, "File:") || strings.HasPrefix(targetStr, "Image:") {
		n := &html.Node{
			Type: html.ElementNode,
			Data: "div",
			Attr: []html.Attribute{
				{Key: "class", Val: "image"},
			},
		}
		link := &html.Node{
			Type: html.ElementNode,
			Data: "a",
			Attr: []html.Attribute{
				{Key: "href", Val: TitleToURL(targetStr)},
			},
		}
		addChild(link, targetStr)
		addChild(n, link)
		children, ok := lcs.([]interface{})
		if ok && len(children) > 0 {
			descDiv := &html.Node{
				Type: html.ElementNode,
				Data: "div",
				Attr: []html.Attribute{
					{Key: "class", Val: "caption"},
				},
			}
			addChild(descDiv, children[len(children)-1])
			addChild(n, descDiv)
		}
		return n, nil
	}
	n := &html.Node{
		Type: html.ElementNode,
		Data: "a",
		Attr: []html.Attribute{
			{Key: "href", Val: TitleToURL(targetStr)},
		},
	}
	if !addChild(n, lcs) {
		addChild(n, targetStr)
	}
	return n, nil
